import React from 'react';

const TouristSpots = () => (
    <div>
        <h2>Tourist Spots</h2>
        <p>Explore Penang's top tourist destinations:</p>
        <ul>
            <li>Penang Hill</li>
            <li>George Town</li>
            <li>Kek Lok Si Temple</li>
        </ul>
    </div>
);

export default TouristSpots;
